import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './menu.css';

function Menu() {
  const [isCollapsed, setIsCollapsed] = useState(window.innerWidth < 1024);

  useEffect(() => {
    const handleResize = () => setIsCollapsed(window.innerWidth < 1024);
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const toggleMenu = () => {
    setIsCollapsed(!isCollapsed);
  };

  return (
    <aside className={`sidebar ${isCollapsed ? 'collapsed' : ''}`}>
      <div className="sidebar-header">
        <button className="toggle-btn" onClick={toggleMenu}>
          {isCollapsed ? '☰' : '⮜'}
        </button>
      </div>

      <nav className="nav-links">
        <Link to="/feed" className="nav-item">
          <span role="img" aria-label="Feed">📰</span>
          {!isCollapsed && <span className="nav-label">Feed</span>}
        </Link>
        <Link to="/search" className="nav-item">
          <span role="img" aria-label="Pesquisar">🔍</span>
          {!isCollapsed && <span className="nav-label">Pesquisar</span>}
        </Link>
        <Link to="/ranking" className="nav-item">
          <span role="img" aria-label="Ranking">👑</span>
          {!isCollapsed && <span className="nav-label">Ranking</span>}
        </Link>
        <Link to="/avisos" className="nav-item">
          <span role="img" aria-label="Avisos">🔔</span>
          {!isCollapsed && <span className="nav-label">Avisos</span>}
        </Link>
        <Link to="/global_chat" className="nav-item">
          <span role="img" aria-label="Chat">💬</span>
          {!isCollapsed && <span className="nav-label">Chat Global</span>}
        </Link>
        <Link to="/training" className="nav-item">
          <span role="img" aria-label="Treinos">🥊</span>
          {!isCollapsed && <span className="nav-label">Treinos</span>}
        </Link>
        <Link to="/locais" className="nav-item">
          <span role="img" aria-label="Locais">📍</span>
          {!isCollapsed && <span className="nav-label">Locais</span>}
        </Link>
        <Link to="/rules" className="nav-item">
          <span role="img" aria-label="Regras">📜</span>
          {!isCollapsed && <span className="nav-label">Regras</span>}
        </Link>

        <div className="nav-bottom">
          <Link to="/profile" className="nav-item">
            <span role="img" aria-label="Perfil">👤</span>
            {!isCollapsed && <span className="nav-label">Perfil</span>}
          </Link>
          <Link to="/logout" className="nav-item">
            <span role="img" aria-label="Sair">🚪</span>
            {!isCollapsed && <span className="nav-label">Sair</span>}
          </Link>
        </div>
      </nav>
    </aside>
  );
}

export default Menu;
